import React from 'react';

import NewsSlider from '../widgets/NewsSlider/slider';
import NewsList from '../widgets/NewsList/newsList';
import VideosList from '../widgets/VideosList/videosList';

import {query, order, duration, videoType, definition} from '../../config';

const Home = () =>{
    return(
        <div>
            <NewsSlider
                type="featured"
                country={'ca'}
                city={''}
                category={'health'}
                amount={5}
                setting={{
                    dots:true
                }}
            />
            <NewsList
                type="detail"
                country={'ca'}
                city={''}
                category={'business'}
                amount={5}
                loadmore={true}
            />
            <VideosList
                type="card"
                query={query}
                order={order}
                duration={duration}
                videoType={videoType}
                definition={definition}
                maxResults={5}
                language={'en'}
                title={true}
                loadmore={true}
            />

        </div>
    )
}

export default Home;
